import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Update cart item quantity
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Electronics');
    await page.click('.search-btn');

    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    await page.waitForSelector('.cart-item', { timeout: 5000 });
    await page.click('.quantity-btn'); // Assuming this is the button to increase quantity
    await page.click('.quantity-btn'); // Click again to increase quantity

    // Take screenshot after updating quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_updated.png'));

    return {
      success: true,
      action: "Updated cart item quantity",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
